  true,\n\t\"url\": null,\n\t\"notes\": \"<p>1995-2016. Centers for Disease Control
  and Prevention (CDC). State Tobacco Activities Tracking and Evaluation (STATE) System.
  \ E-Cigarette Legislationu00e2u0080u0094Preemption. The STATE System houses current
  and historical state-level legislative data on tobacco use prevention and control
  policies.  Data are reported on a quarterly basis. Data include information related
  to statutory state preemption of more stringent local laws on advertising, smokefree
  indoor air, youth access and licensure.</p>n\",\n\t\"license_title\": \"Other License
